      <NavLink to={"hakkimizda"}>HKKIMIZDA</NavLink>
      <NavLink to={"bulezzet"}>BU LEZZETE GÜVEN</NavLink>
      <NavLink to={"restoranlar"}>RESTORANLAR</NavLink>
